import React from "react";
import { Menu, Segment, Container, Grid } from "semantic-ui-react";

export default () => {
  return (
    <Segment inverted>
      <Container>
        <Grid columns={4} divided>
          <Grid.Row></Grid.Row>
        </Grid>
      </Container>
    </Segment>
  );
};
